    if isinstance(key, list):
        # Ensure that list-like indexers are matched with the Series index
        if len(key) > 0 and all(k in self.index for k in key):
            return self.loc[key]
        else:
            # Raise a KeyError for list indexers that do not match any index values
            raise KeyError(f"None of {key} are in the index")
